import { useState } from "react";
import { useCookies } from 'react-cookie';
import { redirect } from "react-router-dom";

function Login() {
    const [username,setusername] = useState("");
    const [pwd,setPwd] = useState("");
    const [cookies,setCookies] = useCookies(['user']);

    const handleSubmit = (e) => {
        e.preventDefault();
        setCookies('Name',username,{path:'/'});
        setCookies('Password',pwd,{path:'/'});
        console.log(cookies.pwd);
        redirect("/home");
    }
    return (
      <div className="App">
       <form onSubmit={handleSubmit}>
        <input name="Username" placeholder="Username" onChange={(e)=>{setusername(e.target.value)}}></input><br/><br/>
        <input name="Password" placeholder="Password" onChange={(e)=>{setPwd(e.target.value)}}></input><br/><br/>
        <button>Submit</button>
       </form>
      </div>
    );
  }

  export default Login;
